While these spam links can be removed, they are a significant nuisance.
</p><p>Sometimes, especially when adding new web links to a page, the wiki may ask you to answer a question.
Since this is a task that is hard to automate, it will allow most real humans to make their contributions while stopping most spammers and other robotic attackers.
</p><p>Please contact the <a href="index_php/Special_ListAdmins.html" title="Special:ListAdmins">site administrators</a> for assistance if this is unexpectedly preventing you from making legitimate contributions.
